import React, { Component } from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import forward from "../src/icons/next.svg";
import backward from "../src/icons/pre.svg";
import { NavLink } from "react-router-dom";
import ic from "../src/images/s5.webp";
export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots:false,
      infinite: true,
      speed: 500,
      autoplay:true,
      autoplayspeed:2000,
      // className:"slides",
      // centerMode:true,
      slidesToShow: 3,
      // fade:true,
      slidesToScroll: 1
    };
    return (
      <section className="top-products">
      <div className="container-2">
          <h1 className="section-heading">Important Topics</h1>
        <h2> Single Item</h2>
        <Slider {...settings}>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
          <div>
           <img className="img5" src="https://images.unsplash.com/photo-1606787364406-a3cdf06c6d0c?ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
          </div>
        </Slider>
      </div>
      </section>
    );
  }
}
